import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note"
import notes from "../notes";
console.log(notes)

function createNotes(note){
    return <Note 
        key={note.id}
        title={note.title}


    />
}


function App(){
    return(
        <div>
            <Header />
            {notes.map(createNotes)}
            <Footer />
        </div>
    )
}
export default App;
